import React from 'react'

export const Repositories = ({repositories, loading}) => {
    if(loading) {
        return <h2 className='m-auto'>Loading...</h2>
    }
  return (
    <ul className="w-2/3 mt-5 m-auto bg-neutral-800 text-neutral-400 select-none">
        {repositories.map(repo => (
        <li key={repo.id}>
            <a className="font-bold hover:text-neutral-300 transition-all" href={repo.html_url} target="_blank" rel = 'noopener'>
            {repo.name}
            </a>
            - {repo.stargazers_count} ⭐️
        </li>
        ))}
  </ul>
  )
}

export default Repositories;
